import React,{useState,useEffect} from "react";



const Trader = ()=>{
    const [data,setData] = useState([])

    useEffect(()=>{
        fetch("/selectTr",{
            method:"GET",
            
        }).then(
            res=>res.json()
        ).then(data=>{
            console.log(data)
            setData(data)
        })
    },[])
        
    
    
    return (
        <div className="table-div"> 
            <table>
                <thead>
                    <tr>
                        <th>trrade_id</th>
                        <th>client</th>
                        <th>instrument</th>
                        <th>quantity</th>
                        <th>direction</th>
                    </tr>
                </thead>
                <tbody>
                {
                    data.end.map(item=>{
                        <tr>
                                <th>{item.trade_id}</th>
                                <th client>{item.client}</th>
                                <th instrument>{item.instrument}</th>
                                <th quantity>{item.quantity}</th>
                                <th direction>{item.direction}</th>
                        </tr> 
                        })
                }
                
                </tbody>
            </table>
        </div>
    )
}

export default Trader
